import React, { Component } from 'react'
import PropTypes from 'prop-types'

class Graph extends Component {
    render() {
        const stock = this.props.stock;

        return (
            <tr>
            {stock.price_y.map((data) => (
                <div>


                <td> {data} </td>
                <td> {data} </td>
                </div>

            ) )

             }
            </tr>


        )

    }
}

//Graph.PropTypes = {
  //  data: PropTypes.array.isRequired
//}
export default Graph;
